import React, { Component } from './node_modules/react'
import WeekSelect from './WeekSelect/WeekSelect';
import TimeSelect from './TimeSelect/TimeSelect';

export default class Calendar extends Component {
  render() {
    return (
      <div>
        <WeekSelect />
        <TimeSelect />
      </div>
    )
  }
}
